import { useNavigate } from "react-router-dom";

import React from 'react';
import "../styles/Menus.css";

function Menus(props) {
  const navigate = useNavigate();
  return (
    <div className='menus' onClick={navigate('/Devlog')}>
        {props.children}
    </div>
  )
}

export default Menus
